import React from 'react'

interface NavBarProps {
    links: Array<{ name: string, to: string}>
}

const NavBar: React.FC<NavBarProps> = (props: Array<{ name: string, to: string}>) => {
    const { links } = props

    return (
        <div>
            <a href={links.to} >{links.name}</a>
        </div>
    );
}

export default NavBar
